import React from 'react';
import styled from 'styled-components';
import { 
  motion,
  useTransform,
  useViewportScroll, 
} from "framer-motion"
import CarInfoDisplay from './CarInfoDisplay';

const StyledSlideTwo = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;
`;

function SlideTwo() {
  // Add the text
  return (
    <StyledSlideTwo className="stickyroll-content">
      <CarInfoDisplay />
    </StyledSlideTwo>
  );
}

export default SlideTwo;
